import './Product.css';

import Product1 from '../Image/product1.jpeg';
import Product2 from '../Image/product2.jpeg';
import Product3 from '../Image/product3.jpeg';
import Product4 from '../Image/product4.jpeg';
import Product5 from '../Image/product5.jpeg';
import Product6 from '../Image/product6.jpeg';
import Product7 from '../Image/product7.jpeg';

import { Col, Container, Row } from "react-bootstrap";

function Product(){

    const ArraysOfProduct = [{
        id: 1,
        image: Product1,
        title: "Now we're getting somewhere",
        subtitle: 'Megan Anderson & Victoria West',
        text: 'Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. At hoc in eo M. Quid de Platone aut de Democrito loquar. Quae in controversiam veniunt, de iis, si placet, disseramus. Iam quae...',
        button: 'Product'
    },
    {
        id: 2,
        image: Product2,
        title: 'Design is a mirror, reflecting the culture',
        subtitle: 'Victoria West & David Cole',
        text: 'Quasi vero aut concedatur in omnibus stultis aeque magna esse vitia, et eadem inbecillitate et inconstantia L. Levatio igitur vitiorum magna fit in iis.',
        button: 'Interior'
    },
    {
        id: 3,
        image: Product3,
        title: 'Everything has beauty, but not everyone sees it',
        subtitle: 'Charles Barrett and others',
        text: 'Utilitatis causa amicitia est quaesita. Quae quo sunt excelsiores, eo dant clariora indicia naturae. Sed...',
        button: 'Story'
    },
    {
        id: 4,
        image: Product4,
        title: 'The perfect place that helps you get work done in peace',
        subtitle: 'Megan Anderson & Charles Barrett',
        text: 'Audio equidem philosophi vocem, Epicure, sed quid tibi dicendum sit oblitus es. Haec et tu...',
        button: 'Lifestyle'
    },
    {
        id: 5,
        image: Product5,
        title: 'Being unique is better than being perfect',
        subtitle: 'Hannah Weastell & Megan Anderson',
        text: 'Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Non autem hoc: igitur ne illud...',
        button: 'Review'
    },
    {
        id: 6,
        image: Product6,
        title: 'I always loves aesthetics',
        subtitle: 'Hannah Weastell & Victoria West',
        text: 'Quasi vero aut concedatur in omnibus stultis aeque magna esse vitia, et eadem inbecilliate et inconstantia',
        button: 'Vogue'
    },
    {
        id: 7,
        image: Product7,
        title: "You've gotta be natural",
        subtitle: 'Hannah Weastell and others',
        text: 'Sed tamen intellego quid velit. Non est igitur summum malum dolor. Tu autem inter haec tantam multitudinem hominum interiectam non vides nec laetantium nec dolentium.',
        button: 'Product'
    }];
    const ArraysOfProductOnMap = ArraysOfProduct.map((ArrayOfProduct) =>
    <div key = {ArrayOfProduct.id} className = "product-element">
        <img src = {ArrayOfProduct.image} className = "w-100 h-100 product-image"/>
        <div className = "product-content">
            <h2 className = "product-title">{ArrayOfProduct.title}</h2>
            <h6 className = "product-subtitle">{ArrayOfProduct.subtitle}</h6>
            <p className = "product-text">{ArrayOfProduct.text}</p>
            <div><button className = "button">{ArrayOfProduct.button}</button></div>
        </div>
    </div> 
    )

    return(
        <Container fluid>
            <div className = "product-wrapper">
                <Row className = "g-2 product-row">
                    <Col lg = "6" md = "12" sm = "12">
                        {ArraysOfProductOnMap[0]}
                    </Col>
                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[1]}
                    </Col>
                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[2]}
                    </Col>
                </Row>
            </div>

            <div className = "product-wrapper">
                <Row className = "g-2">
                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[3]}
                    </Col>

                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[4]}
                    </Col>

                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[5]}
                    </Col>

                    <Col lg = "3" md = "6" sm = "12">
                        {ArraysOfProductOnMap[6]}
                    </Col>
                </Row>
            </div>
        </Container>
    )
}

export default Product
